import React from 'react';
import { Link } from 'react-scroll';

const Sidecar = () => {
  return (
    <div class="container">
<Link activeClass="active" to="intro" spy={true} smooth={true} offset={-100} duration={500} className="navitems"></Link>

    <div class="line"></div>
    <div class="dot About" onclick="toggleColor(this, 'skills')"></div>
    <div class="line"></div>
    <div class="dot Portfolio" onclick="toggleColor(this, 'works')"></div>
    <div class="line"></div>
    <div class="dot Clients" onclick="toggleColor(this, 'contact')"></div>
  </div>
  )
}

export default Sidecar;
